import React from "react";
import Logo from "./Assets/TEMP.jpg";

const Footer = () => {
  return (
    <footer>
      <img src={Logo} alt="" />
      <span>
        Made by Jin Kim with <b>React.js</b> and <b>Node.js</b>.
      </span>
    </footer>
  );
};

export default Footer;
